import React, { Component } from "react";
import "../img";
class Product extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    console.log(this.props.productName.image);
    return (
      <div className="product-container">
        <img src={require(`${this.props.productName.image}`)} />
        <div className="product-descripiton">
          <h6>{this.props.productName.name}</h6>
          <h6 className="price">24$</h6>
        </div>
      </div>
    );
  }
}

export default Product;
